import { configureStore } from '@reduxjs/toolkit'
import gamesReducer from './games/reducer'
import filterSlice from './slices/filterSlice'

const store = configureStore ({
    reducer:{
        games: gamesSlice,
        filter: filterSlice,

    }
})
export default store
